import React from 'react';
import { useSelector } from 'react-redux';

function App() {
  const { token, loading } = useSelector((state) => state.auth);

  console.log('App component rendered with Redux', { token, loading });

  return (
    <div style={{ 
      padding: '20px', 
      backgroundColor: '#f0f0f0', 
      minHeight: '100vh',
      fontFamily: 'Arial, sans-serif'
    }}>
      <h1 style={{ color: 'red', fontSize: '24px' }}>ðŸŽ‰ SUCCESS! App is rendering with Redux!</h1>
      <p style={{ fontSize: '16px', marginTop: '10px' }}>Redux is working correctly.</p>
      <p style={{ fontSize: '14px', color: '#666' }}>Token: {token ? 'Present' : 'None'}</p>
      <p style={{ fontSize: '14px', color: '#666' }}>Loading: {loading ? 'Yes' : 'No'}</p>
      <p style={{ fontSize: '14px', color: '#666' }}>Current time: {new Date().toLocaleTimeString()}</p>

      <div style={{ marginTop: '20px', padding: '10px', backgroundColor: 'white', borderRadius: '5px' }}>
        <h3>Redux State:</h3>
        <pre style={{ backgroundColor: '#f5f5f5', padding: '10px', borderRadius: '3px', fontSize: '12px' }}>
          {JSON.stringify({ token, loading }, null, 2)}
        </pre>
      </div>
    </div>
  );
}

export default App;
